message:
A morte em massa de 23 idosos na Noruega após receberem a vacina covid não está relacionada à vacina Pfizer BioNTec.


Steinar Madsen, Diretor Médico da Agência Norueguesa de Medicamentos (NOMA):

-Não há ligação definitiva entre essas mortes e a vacina;
- Não estamos alarmados ou preocupados com isso porque são casos muito raros e ocorreram em pacientes muito debilitados com doenças muito graves;
-Agora pedimos aos médicos que continuem a vacinação;

Cuidem de seus Pais, Amigos, porque por mais que você seja fã de injeções, acho que a saúde de quem lhe deu a vida deve ser abordada com mais cuidado do que a sua, pela qual só você é pessoalmente responsável.




